import './App.css';
import axios from 'axios'
import {useEffect, useState} from 'react'


function App() {
	const [state, setState] = useState('')
	useEffect(()=>{
		axios.get('http://localhost:8000')	
			.then(res => setState(res.data.text))
			.catch(err => console.log(err))
	}, [])
	return (
		<div className="App">
	     	<h1>{state}</h1>
		</div>
	);
}

export default App;
